// Home.js

import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <nav style={{ backgroundColor: '#D3504A', padding: '10px', fontFamily: 'Poppins', color: 'white' }}>
        <Link to="/" style={{ color: 'white', marginRight: '20px', textDecoration: 'none' }}>
          Home
        </Link>
        <Link to="/expense-tracker" style={{ color: 'white', marginRight: '20px', textDecoration: 'none' }}>
          Expense Tracker
        </Link>
        {/* Add more navigation links as needed */}
      </nav>
      <div style={{ padding: '20px' }}>
        <h1 style={{ fontFamily: 'Poppins', color: '#D3504A' }}>Expense Tracker</h1>
        <p>
          Welcome to the Expense Tracker application. Track your expenses easily and efficiently.
        </p>
        {/* You can add more content or sections here */}
      </div>
    </div>
  );
};

export default Home;
